import { useCallback, useState } from "react";
import { useNavigate } from "react-router-dom";
import styles from "./Desktop.module.css"; // Ensure this path is correct

const Contact = () => {
  const navigate = useNavigate();

  const onHomeTextClick = useCallback(() => {
    navigate("/");
  }, [navigate]);

  const onProjectsTextClick = useCallback(() => {
    navigate("/projects-page");
  }, [navigate]);

  const [formData, setFormData] = useState({
    name: '',
    email: '',
    message: '',
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Form submitted:', formData);
    // Handle form submission logic here
  };

  return (
    <div className={styles.container}>
      <header className={styles.header}>
        <div className={styles.logo}>
          <img className={styles.logoImage} alt="Logo" src="/rectangle-34@2x.png" />
        </div>
        <nav className={styles.navbar}>
          <div className={styles.navItem} onClick={onHomeTextClick}>Home</div>
          <div className={styles.navItem}>About Me</div>
          <div className={styles.navItem} onClick={onProjectsTextClick}>Projects</div>
          <div className={styles.navItem}>Contact</div>
        </nav>
      </header>

      <section id="contact" className={styles.contactSection}>
        <h1 className={styles.sectionHeader}>Contact</h1>
        <div className={styles.contactWrapper}>
          <form id="contact-form" className={styles.formHorizontal} role="form" onSubmit={handleSubmit}>
            <div className={styles.formGroup}>
              <input
                type="text"
                className={styles.formControl}
                id="name"
                placeholder="NAME"
                name="name"
                value={formData.name}
                onChange={handleChange}
                required
              />
            </div>
            <div className={styles.formGroup}>
              <input
                type="email"
                className={styles.formControl}
                id="email"
                placeholder="EMAIL"
                name="email"
                value={formData.email}
                onChange={handleChange}
                required
              />
            </div>
            <textarea
              className={styles.formControl}
              rows="10"
              placeholder="MESSAGE"
              name="message"
              value={formData.message}
              onChange={handleChange}
              required
            ></textarea>
            <button className={styles.sendButton} id="submit" type="submit" value="SEND">
              <div className={styles.altSendButton}>
                <i className="fa fa-paper-plane"></i>
                <span className={styles.sendText}>SEND</span>
              </div>
            </button>
          </form>

          <div className={styles.directContactContainer}>
            <ul className={styles.contactList}>
              <li className={styles.listItem}>
                <i className="fa fa-map-marker fa-2x"></i>
                <span className={styles.contactText}>City, State</span>
              </li>
              <li className={styles.listItem}>
                <i className="fa fa-phone fa-2x"></i>
                <span className={styles.contactText}>
                  <a href="tel:1-212-555-5555" title="Give me a call">(212) 555-2368</a>
                </span>
              </li>
              <li className={styles.listItem}>
                <i className="fa fa-envelope fa-2x"></i>
                <span className={styles.contactText}>
                  <a href="mailto:#" title="Send me an email">hitmeup@gmail.com</a>
                </span>
              </li>
            </ul>

            <hr />

            <ul className={styles.socialMediaList}>
              <li><a href="#" target="_blank" className={styles.contactIcon}><i className="fa fa-github"></i></a></li>
              <li><a href="#" target="_blank" className={styles.contactIcon}><i className="fa fa-codepen"></i></a></li>
              <li><a href="#" target="_blank" className={styles.contactIcon}><i className="fa fa-twitter"></i></a></li>
              <li><a href="#" target="_blank" className={styles.contactIcon}><i className="fa fa-instagram"></i></a></li>
            </ul>

            <hr />

            <div className={styles.copyright}>&copy; ALL OF THE RIGHTS RESERVED</div>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Contact;
